import * as React from 'react';
/**
 * 获取mext context数据
 
 ```
<Consumer>
  {(mext)=>{
    // setMext的数据传递到这里
    console.log(mext);
  }}
</Consumer>
 ```
 */
export default class Consumer extends React.Component<any> {
    shouldComponentUpdate(): boolean;
    render(): JSX.Element;
}
